import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, } from 'react-bootstrap';
import { useParams } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import '../componentes/style.css';


function Salasmod() {
  
  const { id } = useParams();
  const [sala, setFormData] = useState([]);
  
  useEffect(() => {
      async function fetchFormData () {
      
      try {
        
        console.log('id =' + id);
        const response = await axios.get(`http://localhost:2527/api/fndsalas/${id}`);
        setFormData(response.data);      
        console.log('response ' + response.data);
      } catch (error) {
        console.error(error);
      }
  
      };
      fetchFormData();
    },[id]); 
  
  return (    

    <Container fluid>

      <NavSc/>

      <Card>
        <Card.Img className='doriana' variant="top" src={sala.imgsala} />
      <Card.Body>
        <form action="<%= action %>" method="POST">
          <div class="row">
            <div class="col-xs-4">
              <p>Numero:</p>
                <input type="text" name="numero" value={sala.numero} />
            </div>
            <div class="col-xs-4">
              <p>Capacidade:</p>
                <input type="text" name="capacidade" value={sala.capacidade} />
            </div>
            <div class="col-xs-4">  
              <p>Valor:</p>
                <input type="text" name="valor" value={sala.valor} />
            </div>
            <div class="col-xs-4"> 
              <p>Imagem:</p>
                <input type="text" name="imagem" value={sala.imgsala} />
            </div>
            <div class="col-xs-4">
              <p>Descrição:</p>
                <input type="text" name="descricao" value={sala.descricao} />
            </div>
              <input type="submit" value="Salvar" />
          </div>
        </form>

        <Form>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Email address</Form.Label>
        <Form.Control type="email" placeholder="" value={sala.descricao}/>
        <Form.Text className="text-muted">
          We'll never share your email with anyone else.
        </Form.Text>
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control type="password" placeholder="Password" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicCheckbox">
        <Form.Check type="checkbox" label="Check me out" />
      </Form.Group>
      <Button variant="dark" type="submit">
        Submit
      </Button>
      </Form>

      </Card.Body>
      </Card>
      <Bootfooter/>       

    </Container>
  );
}

export default Salasmod;
